import React, { Component } from 'react';
import { Layout } from 'antd';
import { Menu, Icon, Card, List, Button, Tabs, Row, Col, Badge } from 'antd';
import { Link } from "react-router-dom";


const { Header, Sider, Content, Footer } = Layout;

class Home extends Component {
    constructor(props) {
        super(props);

        this.state = {
            current: 'mail'
        }

    }


    handleClick = (e) => {
        console.log('click ', e);
        this.setState({
            current: e.key,
        });
    }
    render() {

        return (
            <div>
                <Layout>
                    <Header>

                        {/* <img src={require('../../images/reliable.png')} width="200px" height="60px"></img> */}

                        <Row>

                            <img src='https://rsrit.com/wp-content/uploads/2017/12/logo_dark.png' width="200px" height="60px"></img>

                            <Menu
                                onClick={this.handleClick}
                                selectedKeys={[this.state.current]}
                                mode="horizontal"
                            >
                                <Menu.Item key="mail">
                                    <Icon type="mail" />Home
                                </Menu.Item>
                            </Menu>


                        </Row>

                    </Header>
                    <Content style={{ margin: '24px 16px', padding: 24, background: '#fff', minHeight: 580 }}>
                        <Row>


                            <Col span={8}> <Link to={{ pathname: "/createNewRequest" }}><Icon type="plus" /> Create TimeSheet</Link> </Col>
                        </Row>
                        <Row>
                            <Col span={8}> <Link to={{ pathname: "/TimeSheetCalander" }}>Monthly Timeshhet </Link> </Col>
                        </Row>
                    </Content>
                    <Footer>Footer</Footer>
                </Layout >

            </div >

        );
    }

}

export default Home;
